import { Component } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-admin-get-all-bills-form',
  templateUrl: './admin-get-all-bills-form.component.html',
  styleUrls: ['./admin-get-all-bills-form.component.css'],
})
export class AdminGetAllBillsFormComponent {
  userForm = new FormGroup({
    username: new FormControl('', [Validators.required]),
    password: new FormControl(''),
  });

  constructor() {
    this.userForm.setValue({ username: ' ', password: ' ' });
  }

  onSubmit() {
    console.log('UserName' + this.userForm.get('username')?.value);
    console.log('Password' + this.userForm.get('password')?.value);
  }
}
<h1>Admin</h1>
<h3>Get All Bill Reports</h3>
<form [formGroup]="userForm" (ngSubmit)="onSubmit()" method="get">
  <input
    type="text"
    id="username"
    name="userName"
    formControlName="username"
    placeholder="Enter admin username"
  />
  <input
    type="password"
    id="password"
    name="password"
    formControlName="password"
    placeholder="Enter admin password"
  />
  <button type="submit">Submit</button>
</form>
